  return (
      <Router>
          <div className="main_container">
    <div className="App">
        <Image/>
        <h1>Mój Dom</h1>
    </div>
      <div className="buttons">
          <Switch>
          <button className="btn"><Route path="/Kitchen"><Kitchen/>Stan Kuchni</Route></button>
          </Switch>
          <button className="btn">Stan Przemysłu</button>
          <button className="btn">Lista Zakupów</button>
          <button className="btn">Pogoda</button>
      </div>
          </div>

      </Router> );
}

export default App;
